import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <img src="http://www.pngplay.com/wp-content/uploads/1/Letter-V-PNG-Stock-Photo.png" />
        <h1>utu</h1>
      </header>

      <aside>
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>

        <div><a>Settings</a></div>
      </aside>

      <main>
        <div className="banner">
          <img src="https://www.petrozavodsk-travel.ru/wp-content/uploads/2016/09/1-9.jpg" />
        </div>


      </main>
    </div>
  );
}

export default App;
